import React from 'react';
import BookList from '../book-list';

const HomePage = () => {
  const books = [
    {
      id: 1,
      name: 'Production-Ready Microservices',
      author: 'Susan J. Flower'
    },
    {
      id: 2,
      name: 'Release It!',
      author: 'Michal T. Nygard'
    }
  ];
  return (
    <BookList book={[]} />)
};
export default HomePage;
